import useSetting from '../../hooks/useSetting';



function Home() {
  const { setting, changeSetting } = useSetting();
  const { data, changeData } = useSetting();

  useEffect(() => {
      console.log(setting);
      console.log(data);

  });


  return (
    <div>
      Home asdfg
      <h2>
        Theme Color: {setting.theme_color}
        Name: {data.first_name} {data.last_name}
      </h2>
      <button onClick={()=>changeSetting('theme_color','dark')}>Change</button>
      <button onClick={()=>changeData('fi','dark')}>Change</button>

      <br />
      <br />
    </div>
  )
}

export default Home;
